import React from 'react'
const [result, setResult] = React.useState("");

export const Contact = () => {
  const onSubmit = async (event) => {
    event.preventDefault();
    setResult("Sending....");
    const formData = new FormData(event.target);

    formData.append("access_key", "YOUR_ACCESS_KEY_HERE");

    const response = await fetch("https://api.web3forms.com/submit", {
      method: "POST",
      body: formData
    });

    const data = await response.json();

    if (data.success) {
      setResult("Form Submitted Successfully");
      event.target.reset();
    } else {
      console.log("Error", data);
      setResult(data.message);
    }
  };
  return (
    <> 
    <div id="Contact">
    <h1>CONTACT</h1></div>
    <section className="contact">
    <form>
    <h2>Contact Me</h2>
    <div className="input-box">
          <label>Full Name</label>
          <input type="text" className="feild" placeholder="enter yor name" required/>
          <label>Email Address</label>
          <input type="email" className="feild" placeholder="enter yor email" required/>
        </div>
        <div className="input-box">
          <label>Your Message</label>
          <textarea name="" className="feildmes" id="" placeholder="enter your message" required></textarea>
        </div>
        <button type="submit">Send message</button>
    </form>
    </section>
      </>
   )
}


export default Contact
